// src/pages/CartPage.js
import React, { useEffect, useState } from "react";
import { Box, Typography, Paper, Button, Grid, Divider } from "@mui/material";
import { getCart } from "../api/cart";
import { useNavigate } from "react-router-dom";

export default function CartPage() {
  const [cart, setCart] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    getCart()
      .then((res) => setCart(res.data))
      .catch(console.error);
  }, []);

  const total = cart.reduce(
    (sum, it) => sum + (it.totalPrice ?? it.basePrice * (it.quantity || 1)),
    0
  );

  const handlePlaceOrder = () => {
    navigate("/checkout");
  };

  if (!cart.length)
    return <Typography sx={{ p: 3 }}>Your cart is empty.</Typography>;

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" sx={{ mb: 3, fontWeight: "bold" }}>
        My Cart
      </Typography>

      <Grid container spacing={2}>
        {cart.map((item) => {
          const imgSrc = `/images/${item.product?.image || item.image}`;

          const selectedShape = item.selectedShape || "None";
          const selectedSize = item.selectedSize || "None";

          // SAFE TOPPINGS FIX — convert to array if it’s not
          const toppings = Array.isArray(item.selectedToppings)
            ? item.selectedToppings
            : item.selectedToppings
            ? [item.selectedToppings]
            : [];

          return (
            <Grid item xs={12} key={item.id}>
              <Paper
                sx={{
                  p: 2,
                  borderRadius: "12px",
                  display: "flex",
                  gap: 2,
                  alignItems: "flex-start",
                }}
              >
                {/* Product Image */}
                <img
                  src={imgSrc}
                  alt={item.product?.name || item.name}
                  width="120"
                  height="120"
                  style={{
                    borderRadius: "10px",
                    objectFit: "cover",
                  }}
                />

                <Box sx={{ flexGrow: 1 }}>
                  {/* Name */}
                  <Typography variant="h6" sx={{ fontWeight: "bold" }}>
                    {item.product?.name || item.name}
                  </Typography>

                  <Typography sx={{ mb: 1 }}>
                    Quantity: <b>{item.quantity}</b>
                  </Typography>

                  {/* Customization Section */}
                  <Divider sx={{ my: 1 }} />

                  <Typography sx={{ fontWeight: "bold", mb: 1 }}>
                    Customizations:
                  </Typography>

                  <Typography sx={{ ml: 1 }}>
                    Shape: <b>{selectedShape}</b>
                  </Typography>

                  <Typography sx={{ ml: 1 }}>
                    Size: <b>{selectedSize}</b>
                  </Typography>

                  <Typography sx={{ ml: 1 }}>
                    Toppings:{" "}
                    <b>
                      {toppings.length
                        ? toppings.join(", ")
                        : "No toppings selected"}
                    </b>
                  </Typography>

                  <Divider sx={{ mt: 2, mb: 1 }} />

                  {/* Price */}
                  <Typography variant="h6" sx={{ color: "green" }}>
                    ₹{item.totalPrice ?? item.basePrice * item.quantity}
                  </Typography>
                </Box>
              </Paper>
            </Grid>
          );
        })}
      </Grid>

      {/* Total */}
      <Typography variant="h5" sx={{ mt: 3, fontWeight: "bold" }}>
        Total: ₹{total}
      </Typography>

      {/* Place Order Button */}
      <Button
        variant="contained"
        color="primary"
        sx={{ mt: 3, p: 1.5, fontSize: "16px" }}
        onClick={handlePlaceOrder}
      >
        Place Order
      </Button>
    </Box>
  );
}
